request.description:
Logout endpoint untuk menghapus authentication token

**Headers:**
- Authorization: Bearer {token}

**Success Response (200):**
```json
{
  "message": "Logout berhasil"
}
```

Mendapatkan informasi user yang sedang login

**Headers:**
- Authorization: Bearer {token}

**Success Response (200):**
```json
{
  "user": {
    "id": 1,
    "name": "okan",
    "email": "okan@gmail.com"
  }
}
```

Mendapatkan informasi stok semua produk

**Headers:**
- Authorization: Bearer {token}

**Success Response (200):**
```json
{
  "success": true,
  "data": [
    {
      "id": 1,
      "name": "Cappuccino",
      "stock": 50,
      "min_stock": 10,
      "is_available": true,
      "status": "in_stock"
    }
  ]
}
```
